CREATE TABLE `Blog` (
  `blog_id` int NOT NULL AUTO_INCREMENT,
  `employee_id` int NOT NULL,
  `title` varchar(255) NOT NULL,
  `content` text NOT NULL,
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`blog_id`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `Blog_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `Employees` (`employee_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Chat` (
  `chat_id` int NOT NULL AUTO_INCREMENT,
  `employee_id` int DEFAULT NULL,
  `content` varchar(255) DEFAULT NULL,
  `room_id` varchar(255) DEFAULT NULL,
  `date_chat` datetime DEFAULT NULL,
  PRIMARY KEY (`chat_id`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `Chat_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `Employees` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=185 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Comments` (
  `comment_id` int NOT NULL AUTO_INCREMENT,
  `blog_id` int NOT NULL,
  `employee_id` int NOT NULL,
  `comment_content` text NOT NULL,
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`comment_id`),
  KEY `blog_id` (`blog_id`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `Comments_ibfk_1` FOREIGN KEY (`blog_id`) REFERENCES `Blog` (`blog_id`) ON DELETE CASCADE,
  CONSTRAINT `Comments_ibfk_2` FOREIGN KEY (`employee_id`) REFERENCES `Employees` (`employee_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Employees` (
  `employee_id` int NOT NULL AUTO_INCREMENT,
  `full_name` varchar(50) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password` varchar(255) NOT NULL,
  `phone_number` varchar(15) DEFAULT NULL,
  `avatar` varchar(255) DEFAULT NULL,
  `date_of_birth` date DEFAULT NULL,
  `hire_date` date DEFAULT NULL,
  `salary` int DEFAULT NULL,
  `role` varchar(255) DEFAULT NULL,
  `refresh_token` text,
  `face_embeddings` json DEFAULT NULL,
  PRIMARY KEY (`employee_id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Group_Chat_Messages` (
  `message_id` int NOT NULL AUTO_INCREMENT,
  `group_id` int NOT NULL,
  `sender_id` int NOT NULL,
  `content` text NOT NULL,
  `sent_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`message_id`),
  KEY `group_id` (`group_id`),
  KEY `sender_id` (`sender_id`),
  CONSTRAINT `Group_Chat_Messages_ibfk_1` FOREIGN KEY (`group_id`) REFERENCES `Projects` (`project_id`) ON DELETE CASCADE,
  CONSTRAINT `Group_Chat_Messages_ibfk_2` FOREIGN KEY (`sender_id`) REFERENCES `Employees` (`employee_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Projects` (
  `project_id` int NOT NULL AUTO_INCREMENT,
  `project_name` varchar(100) NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  `progress` int DEFAULT NULL,
  PRIMARY KEY (`project_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Tasks` (
  `task_id` int NOT NULL AUTO_INCREMENT,
  `task_name` varchar(255) NOT NULL,
  `description` text,
  `assigned_to` int DEFAULT NULL,
  `status` varchar(20) NOT NULL,
  `priority` varchar(20) DEFAULT NULL,
  `project_id` int DEFAULT NULL,
  `reporter` int DEFAULT NULL,
  `status_task` varchar(20) DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  PRIMARY KEY (`task_id`),
  KEY `assigned_to` (`assigned_to`),
  KEY `project_id` (`project_id`),
  KEY `reporter` (`reporter`),
  CONSTRAINT `Tasks_ibfk_1` FOREIGN KEY (`assigned_to`) REFERENCES `Employees` (`employee_id`),
  CONSTRAINT `Tasks_ibfk_2` FOREIGN KEY (`project_id`) REFERENCES `Projects` (`project_id`),
  CONSTRAINT `Tasks_ibfk_3` FOREIGN KEY (`reporter`) REFERENCES `Employees` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Team_Members` (
  `team_member_id` int NOT NULL AUTO_INCREMENT,
  `project_id` int NOT NULL,
  `employee_id` int NOT NULL,
  `is_in_group_chat` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`team_member_id`),
  KEY `project_id` (`project_id`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `Team_Members_ibfk_1` FOREIGN KEY (`project_id`) REFERENCES `Projects` (`project_id`) ON DELETE CASCADE,
  CONSTRAINT `Team_Members_ibfk_2` FOREIGN KEY (`employee_id`) REFERENCES `Employees` (`employee_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `Timesheets` (
  `timesheet_id` int NOT NULL AUTO_INCREMENT,
  `employee_id` int DEFAULT NULL,
  `date_timekeeping` date DEFAULT NULL,
  `clock_in` varchar(100) DEFAULT NULL,
  `clock_out` varchar(100) DEFAULT NULL,
  `hours_worked` varchar(100) NOT NULL,
  PRIMARY KEY (`timesheet_id`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `Timesheets_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `Employees` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

